description:
&quot;Rachel and Shane have the perfect marriage or so you'd think! The truth is - their relationship is nothing more than an illusion, as Rachel is still pining for her long-lost first love, Jim. In a matter of moments - life goes from simple to complicated, as Jim returns to claim Rachel. Harvest Moon casts an intense and erotic light upon the ultimate love triangle.&quot;

Remy La Croix, Chloe Amour, Christy Mack, Madison Fox, Danny Mountain, Erik Everhard, Mr. Pete, Will Powers, Xander Corvus.

